//[阵法]阵形材料基础概率package cn.mxz;public class FormationBasisTemplet implements BasisTemplet {	/** 	 * 品阶等级组合列 	 */	private String spetLv;	/** 	 * 阵法等级 	 */	private int formationLv;	/** 	 * 阵法品质 	 */	private int formationSpet;	/** 	 * 基础概率 	 */	private float basisPro;	/**	 * 品阶等级组合列	 */	void setSpetLv(String spetLv) {		this.spetLv = spetLv;	}	/**	 * 品阶等级组合列	 */	public String getSpetLv() {		return this.spetLv;	}	/**	 * 阵法等级	 */	void setFormationLv(int formationLv) {		this.formationLv = formationLv;	}	/**	 * 阵法等级	 */	public int getFormationLv() {		return this.formationLv;	}	/**	 * 阵法品质	 */	void setFormationSpet(int formationSpet) {		this.formationSpet = formationSpet;	}	/**	 * 阵法品质	 */	public int getFormationSpet() {		return this.formationSpet;	}	/**	 * 基础概率	 */	void setBasisPro(float basisPro) {		this.basisPro = basisPro;	}	/**	 * 基础概率	 */	public float getBasisPro() {		return this.basisPro;	}}